description:
Sagas are stories about ancient Scandinavian and Germanic history. Saga of Erik the Red is a saga on the Norse exploration of North-America. It chronicles the events that led to Erik the Red's banishment to Greenland, Leif Ericson's discovery of Vinland the Good after his longship was blown off course.

